import {
    computed, toJS,
    makeAutoObservable } from "mobx";
import {
    booksSearch
} from "../services/index.js";

class Mobx {
    booksData = {}

    constructor() {
        makeAutoObservable(this, {
            getBooksData: computed
        });
    }

    get getBooksData() {
        return toJS(this.booksData);
    }

    booksSearch = (data) => {
        this.list = booksSearch(data);
    }
}

const MyMobx = new Mobx();
export default MyMobx;
